import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';
import EventList from './components/EventList';
import EventForm from './components/EventForm';
import EventDetail from './components/EventDetail';
import BookingForm from './components/BookingForm';

function App() {
  return (
    <BrowserRouter>
      <div>
        <h1>Event Booking App</h1>
        <ul>
          <li><Link to="/">Event List</Link></li>
          <li><Link to="/event-form">Event Form</Link></li>
          <li><Link to="/event-detail">Event Detail</Link></li>
          <li><Link to="/booking-form">Booking Form</Link></li>
        </ul>
        <Route path="/" exact component={EventList} />
        <Route path="/event-form" component={EventForm} />
        <Route path="/event-detail" component={EventDetail} />
        <Route path="/booking-form" component={BookingForm} />
      </div>
    </BrowserRouter>
  );
}

export default App;
